import '../../css/App.css';
import logo from '../../img/SillyCoder.png';
import { motion } from 'framer-motion';
import React from 'react';

var cs;

var mi;

var btn1text = "Start";

var btn2text = "Go Functions";

var btn3text = "Go Home";

var playstate = "Play";

let münzen = 0;

let humantokens = 0;

var compwin = false;

var playerwin = false;

var playing = false;

function NimmGame() {

    const [refresh, setRefresh] = React.useState(0)


    const dash = () => {
        window.location = "/dashboard";
    }
    
    const C1 = () => {
        if (playing === true) {
            if(münzen !== 0){
                münzen -= 1;
                humantokens = 1;
                mi = "Coins: " + münzen;
                Computer();
            } else {
                compwin = true;
                playerwin = false;
                PlayAgain();
            }  
        } else {
            playstate = "Playing"
            Play();
        }
    }

    const C2 = () => {
        if (playing === true) {
            if(münzen !== 0){
                münzen -= 2;
                humantokens = 2;
                mi = "Coins: " + münzen;;
                Computer();
            } else {
                compwin = true;
                playerwin = false;
                PlayAgain();
            }  
        } else {
            window.location.href = "../functions";
        }
    }
    
    const C3 = () => {
        if (playing) {
            if(münzen !== 0) {
                münzen -= 3;
                humantokens = 3;
                mi = "Coins: " + münzen;;
                Computer();
            } else {
                compwin = true;
                PlayAgain();
            }
        } else {
            window.location.href = "../../";
        }
    }

    return (
        <body>
            <nav>
                <div className='logoNav'>
                    
                    <motion.a
                    href='../index'
                    whileHover={{scale: 1.1}}
                    whileTap={{scale: 0.9}}
                    ><img className='round' alt='' src={logo} width="150px" height="150px" ></img>
                    </motion.a>

                    <h1 className='middle' style={{alignItems: 'center', color:'dodgerblue'}} id='playState'>{playstate} NimmGame on SillyCode.tech</h1>
                    
                    <motion.button
                    whileHover={{scale: 1.1}}
                    whileTap={{scale: 0.9}}
                    className='indexBtn' 
                    onClick={() => {dash();}}
                    >Dashboard</motion.button>  
                     
                </div>   
            </nav>
            <br/>

            <main className='grid'>
                <span className='middle' style={{alignItems:'center'}}>{mi}</span>
                <div className='grid-around-space'>
                    <div className='middle'>      
                        <motion.button
                                whileHover={{scale: 1.1}}
                                whileTap={{scale: 0.9}}
                                className='indexBtn' 
                                onClick={() => {setRefresh(refresh + 1);C1();}}
                                >{btn1text}</motion.button> 
                    </div>
                </div>
                <span className='middle' style={{alignItems:'center'}}>{cs}</span>
                <span></span>
                <div className='grid-around-space'>
                    <div className='middle'>      
                        <motion.button
                                whileHover={{scale: 1.1}}
                                whileTap={{scale: 0.9}}
                                className='indexBtn' 
                                onClick={() => {setRefresh(refresh + 1);C2();}}
                                >{btn2text}</motion.button> 
                    </div>
                </div>
                <br/>
                <span></span>
                <div className='grid-around-space'>
                    <div className='middle'>      
                    <motion.button
                            whileHover={{scale: 1.1}}
                            whileTap={{scale: 0.9}}
                            className='indexBtn' 
                            onClick={() => {setRefresh(refresh + 1);C3();}}
                            >{btn3text}</motion.button> 
                    </div>
                </div>
                
            </main>
        </body>
      );
}

function Play() {
    cs="";
    münzen = random(10,20);
    mi = "Coins: " + münzen;
    btn1text="1";
    btn2text="2";
    btn3text="3";
    playing = true;
}
        
function Computer() {
    mi = "Coins: " + münzen;
    if(münzen > 0) {
        var computertokens = 4 - humantokens;
            if(münzen - computertokens > 0) {
                münzen -= computertokens;
              cs="Computer makes minus " + computertokens + "." ;
                if(münzen === 0) {
                    playerwin = true;
                    compwin = false;
                    cs="Du hast Gewonnen";
                    PlayAgain();
                }
            } else {
                computertokens = 1;
                while(münzen - computertokens > 0){
                    computertokens++;
                }
                münzen -= computertokens;
                cs="Computer makes minus " + computertokens ;
                if(münzen === 0) {
                    playerwin = true;
                    compwin = false;
                    cs="You Win";
                    PlayAgain();
                }
            } 
    } else {
        compwin = true;
        playerwin = false;
        PlayAgain();
    }       
    mi = "Müzen: " + münzen;
    
}


function PlayAgain(){
    playstate = "Play Again"
    playing = false;
    if(playerwin === true) {
        cs="Du hast Gewonnen";
    } else if(compwin === true) {
        cs="Du hast Verloren";
     }

    btn1text="Play Again";
    btn2text="Go Home";
    btn3text="Go to Functions";
    compwin = false;
	playerwin = false;    
}

function random(min, max){
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min) + min); // The maximum is exclusive and the 
}

export default NimmGame;
